drop table if exists ADHERENT cascade;

drop table if exists ALIMENT cascade;

drop table if exists A_ETE_VU cascade;

drop table if exists DEPARTEMENT cascade;

drop table if exists ESPECE cascade;

drop table if exists EST_PRESENT cascade;

drop table if exists MANGE cascade;

drop table if exists MOIS cascade;

drop table if exists REGION cascade;

drop table if exists RELEVE cascade;

/*==============================================================*/
/* Table : ADHERENT                                             */
/*==============================================================*/
create table ADHERENT (
NUMADHERENT          INT4                 not null,
NUMDEPARTEMENT       INT4                 not null,
NOM                  VARCHAR(20)          not null,
PRENOM               VARCHAR(20)          not null,
ADRESSE              VARCHAR(100)         null,
CODEPOSTAL           CHAR(5)              null,
COMMUNE              VARCHAR(30)          null,
MAIL                 VARCHAR(50)          not null check(mail like '%@%'),
TELFIXE              VARCHAR(10)          null check(TELFIXE = '' or TELFIXE like '01%' or TELFIXE like '02%' or TELFIXE like '03%' or TELFIXE like '04%' or TELFIXE like '05%') ,
TELMOBILE            VARCHAR(10)          null check(TELMOBILE = '' or TELMOBILE like '06%' or TELMOBILE like '07%'),
TELPRO               VARCHAR(10)          null check(TELPRO = '' or TELPRO like '06%' or TELPRO like '07%'),
constraint PK_ADHERENT primary key (NUMADHERENT),
constraint UQ_MAIL unique (MAIL),
constraint UQ_NOM_PRENOM_TELFIXE unique (NOM, PRENOM, TELFIXE)
);

/*==============================================================*/
/* Table : ALIMENT                                              */
/*==============================================================*/
create table ALIMENT (
NUMALIMENT           INT4                 not null,
NOMALIMENT           VARCHAR(20)          null,
constraint PK_ALIMENT primary key (NUMALIMENT)
);

/*==============================================================*/
/* Table : A_ETE_VU                                             */
/*==============================================================*/
create table A_ETE_VU (
NUMRELEVE            INT4                 not null,
NUMESPECE            INT4                 not null,
NBOISEAU             INT4                 null 
      constraint CKC_NBOISEAU_A_ETE_VU check (NBOISEAU is null or (NBOISEAU between 1 and 50)),
ESTIMATIONOISEAU     VARCHAR(20)          null,
constraint PK_A_ETE_VU primary key (NUMRELEVE, NUMESPECE)
);

/*==============================================================*/
/* Table : DEPARTEMENT                                          */
/*==============================================================*/
create table DEPARTEMENT (
NUMDEPARTEMENT       INT4                 not null,
CODEDEPARTEMENT		 VARCHAR(3)			  null,
NUMREGION            INT4                 not null,
NOM                  VARCHAR(50)          null,
SUPERFICIE           INT4                 null 
      constraint CKC_SUPERFICIE_DEPARTEM check (SUPERFICIE is null or (SUPERFICIE between 1 and 100000)),
constraint PK_DEPARTEMENT primary key (NUMDEPARTEMENT)
);

/*==============================================================*/
/* Table : ESPECE                                               */
/*==============================================================*/
create table ESPECE (
NUMESPECE            INT4                 not null,
NOMESPECE            VARCHAR(30)          null,
NOMSCIENTIFIQUE      VARCHAR(30)          null,
POIDSMIN             INT4                 null,
POIDSMAX             INT4                 null,
LONGUEUR             INT4                 null,
ENVERGUREMIN         INT4                 null,
ENVERGUREMAX         INT4                 null,
constraint PK_ESPECE primary key (NUMESPECE)
);

/*==============================================================*/
/* Table : EST_PRESENT                                          */
/*==============================================================*/
create table EST_PRESENT (
NUMMOIS              INT4                 not null check (NUMMOIS between 1 and 12),
NUMESPECE            INT4                 not null,
constraint PK_EST_PRESENT primary key (NUMMOIS, NUMESPECE)
);

/*==============================================================*/
/* Table : MANGE                                                */
/*==============================================================*/
create table MANGE (
NUMESPECE            INT4                 not null,
NUMALIMENT           INT4                 not null,
constraint PK_MANGE primary key (NUMESPECE, NUMALIMENT)
);

/*==============================================================*/
/* Table : MOIS                                                 */
/*==============================================================*/
create table MOIS (
NUMMOIS              INT4                 not null check (NUMMOIS between 1 and 12),
NOM                  VARCHAR(50)          null,	
constraint PK_MOIS primary key (NUMMOIS)
);

/*==============================================================*/
/* Table : REGION                                               */
/*==============================================================*/
create table REGION (
NUMREGION            INT4                 not null,
NOM                  VARCHAR(50)          null,
constraint PK_REGION primary key (NUMREGION)
);

/*==============================================================*/
/* Table : RELEVE                                               */
/*==============================================================*/
create table RELEVE (
NUMRELEVE            INT4                 not null,
NUMADHERENT          INT4                 not null,
NUMDEPARTEMENT       INT4                 not null,
DATEOBSERVATION      DATE                 null,
LIEU                 VARCHAR(20)          null,
LONGITUDE            DECIMAL(9,6)         null,
LATITUDE             DECIMAL(9,6)         null,
constraint PK_RELEVE primary key (NUMRELEVE)
);

alter table ADHERENT
   add constraint FK_ADHERENT_RESIDE_DA_DEPARTEM foreign key (NUMDEPARTEMENT)
      references DEPARTEMENT (NUMDEPARTEMENT)
      on delete restrict on update restrict;

alter table A_ETE_VU
   add constraint FK_A_ETE_VU_A_ETE_VU_ESPECE foreign key (NUMESPECE)
      references ESPECE (NUMESPECE)
      on delete restrict on update restrict;

alter table A_ETE_VU
   add constraint FK_A_ETE_VU_A_ETE_VU2_RELEVE foreign key (NUMRELEVE)
      references RELEVE (NUMRELEVE)
      on delete restrict on update restrict;

alter table DEPARTEMENT
   add constraint FK_DEPARTEM_FAIT_PART_REGION foreign key (NUMREGION)
      references REGION (NUMREGION)
      on delete restrict on update restrict;

alter table EST_PRESENT
   add constraint FK_EST_PRES_EST_PRESE_ESPECE foreign key (NUMESPECE)
      references ESPECE (NUMESPECE)
      on delete restrict on update restrict;

alter table EST_PRESENT
   add constraint FK_EST_PRES_EST_PRESE_MOIS foreign key (NUMMOIS)
      references MOIS (NUMMOIS)
      on delete restrict on update restrict;

alter table MANGE
   add constraint FK_MANGE_MANGE_ALIMENT foreign key (NUMALIMENT)
      references ALIMENT (NUMALIMENT)
      on delete restrict on update restrict;

alter table MANGE
   add constraint FK_MANGE_MANGE2_ESPECE foreign key (NUMESPECE)
      references ESPECE (NUMESPECE)
      on delete restrict on update restrict;

alter table RELEVE
   add constraint FK_RELEVE_EST_DANS_DEPARTEM foreign key (NUMDEPARTEMENT)
      references DEPARTEMENT (NUMDEPARTEMENT)
      on delete restrict on update restrict;

alter table RELEVE
   add constraint FK_RELEVE_REDIGE_ADHERENT foreign key (NUMADHERENT)
      references ADHERENT (NUMADHERENT)
      on delete restrict on update restrict;

ALTER TABLE ADHERENT
ADD COLUMN LATITUDE DECIMAL(9,6),
ADD COLUMN LONGITUDE DECIMAL(9,6);

















select numespece,numaliment 
from espece 
cross join aliment
order by 1,2;

DELETE FROM mange
WHERE (numespece, numaliment) IN
(SELECT numespece,numaliment FROM mange
ORDER BY RANDOM()
LIMIT (320*0.2));
